        fetch("https://api2.binance.com/api/v3/ticker/24hr")
            .then(res => res.json())
            .then(
                (result) => {
                    //   setIsLoaded(true);
                    setItems(result);
                    // console.log(result)
                },
                (error) => {
                    console.log(error)
                }
            )

    }, [])
    console.log(items)

    return (
        <div>
            <Card>

                <Info>
                    <h3>BTC</h3>
                </Info>

                <PriceChange>
                    <h1>$ 65,000</h1>
                    <p> -2.55% </p>
                </PriceChange>

            </Card>
        </div>
    )
}

